import React from 'react'
import { connect } from 'react-redux'
import * as qActions from '../../reducer/portal/query/actions'
import * as cActions from '../../reducer/credentials/actions'

interface Item {
  id: string,
  title?: string,
  created?: {},
  tags?: string[]
}

interface ItemProps {
  userItems: Item[],
}

export class QueryTable extends React.Component <ItemProps, any> {
  constructor(props: any) {
    super(props)
    this.state = {

    }
  }

  public static defaultProps = {
    userItems: [{id:'',}],
  }

  render() {
    console.log("query-table")
    return (
      <div className="queryTable" >
        <table>
          <thead>
            <tr>
              <th>item</th><th>created</th><th>tags</th><th>...</th>
            </tr>
          </thead>
          <tbody>
            {this.props.userItems.map((userItems,index) => (
            <tr key={index} id={userItems.id}>
              <td>${userItems.title}</td>
              <td>${userItems.created}</td>
              <td>${userItems.tags}</td>
              <td><button>Edit tags</button></td>
            </tr>
            ))}
          </tbody>
        </table>
      </div>
    )
  }
}

const mapStateToProps = ({ query: { userItems }}:any) => ({
  userItems,
})
//const mapDispatchToProps = (dispatch:any) => { }

export default connect(mapStateToProps, )(QueryTable)
